import Vue from 'vue'
import App from './App.vue'
import router from "./router";
import store from './store/store.js'

Vue.config.productionTip = false

Vue.mixin({
  methods: {
    dateNow: function () {
      const date = new Date();
      const fdate =
        date.getDay() +
        "/" +
        date.getMonth() +
        "/" +
        date.getFullYear() +
        " " +
        date.getHours() +
        ":" +
        date.getMinutes();
      return fdate;
    },
    dateHourNow: function () {
      const date = new Date();
      const hour = date.getHours() + ":" + date.getMinutes();
      return hour;
    },
    weekDay: function(){
      const date = new Date();
      return date;
    }
  },
})


new Vue({
  router,
  store,
  render: h => h(App),
}).$mount('#app')
